    (dump))

(-> (new-mat 30 30 CV_8UC3 rgb/yellow-2) g/>>)

(-> (new-mat 3 3 CV_8UC3 rgb/yellow-2)
    (transform! custom)
    (dump))

(-> (new-mat 30 30 CV_8UC3 rgb/yellow-2)
    (transform! custom)
    g/>>)
